import React from "react";
import {makeStyles, withStyles} from "@material-ui/core/styles";
import {Container} from "@material-ui/core";
import Typography from "@material-ui/core/Typography";
import Grid from "@material-ui/core/Grid";

const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1,
        zIndex: -9999,
    },
    marginAll: {
        marginTop: theme.spacing(10),
        marginBottom: theme.spacing(10),
        background: '#29c3be',
    },
    zIndexCircle: {
        position: 'absolute',
        zIndex: 10,
        marginTop: theme.spacing(15),
    },
    zIndexBlob: {
        position: 'absolute',
        zIndex: 10,
    },
    zIndexDog: {
        position: 'relative',
        zIndex: 15,
        bottom: -4,
        marginTop: theme.spacing(5),
    },
    typographyStyles: {
        fontSize: '36px',
        lineHeight: '42px',
        marginTop: theme.spacing(8),
    },
}));

function Dog() {
    const classes = useStyles();

    return (
        <div className={classes.root}>
            <div className={classes.marginAll}>
                <Grid
                    container
                    justify="flex-start"
                    alignItems="flex-start"
                >
                    <Grid item sm={6}>
                        <img src={require('../images/Stylize Circles.png')} className={classes.zIndexCircle}/>
                        <img src={require('../images/Blob 3.png')} className={classes.zIndexBlob}/>
                        <img src={require('../images/BigDog.png')} className={classes.zIndexDog}/>
                    </Grid>
                    <Grid item sm={4} className={classes.typographyStyles}>
                        <p>
                            Nemo enim ipsam voluptatem quia voluptas in proident
                        </p>
                    </Grid>
                </Grid>
            </div>

        </div>
    )
}

export default Dog;
